 0, 'custom', '', 'gallery_default', '', NULL, '', NULL, '', '', 0, 300, 0, '', 0, 0, 0, 0, 0, '', NULL, '', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', 'a:2:{i:0;s:0:"";i:1;s:0:"";}', '', '', '', 'ascending', 0, '', '', '', '', 'com_default', '', '', '', NULL, 0, '', '', '', '', '', '', '', '', '', 0, '0', 0, 0, '', 0, '', '', '', '1', '', '', '', '1', '1', '', '' );
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`) VALUES ( 1, 1, 128, 1385566458, 'Darf ich Open Sauce kommerziell einsetzen?', 'kommerzieller-einsatz', 1, '<p>Ja, allerdings benÃ¶tigen Sie eine Premium-Lizenz, wenn Sie den Copyright Hinweis in der FuÃŸzeile entfernen mÃ¶chten. Das gilt auch, wenn Sie Open Sauce als Basis verwenden und es fÃ¼r einen Kunden verÃ¤ndern.</p>\n<p>Beachten Sie bitte, dass Sie Open Sauce unter keinen UmstÃ¤nden selbst zum Download anbieten dÃ¼rfen. AuÃŸerdem darf Open Sauce (oder Teile davon) nicht als Basis fÃ¼r Themes genutzt werden, die Sie spÃ¤ter selbst verkaufen mÃ¶chten.</p>\n<p>Hier finden Sie die <a href="http://rocksolidthemes.com/de/contao/lizenzbedigungen">gesamten Lizenzbedingungen</a>. Abgesehen von den rechtlichen Details, wÃ¼nschen wir Ihnen viel Freude und Erfolg mit Open Sauce.</p>', '', NULL, '', '', '', '', '', '', '', '', NULL, '', '1' );
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`) VALUES ( 2, 1, 256, 1399615485, 'Welche Versionen werden UnterstÃ¼tzt?', 'unterstuetzte-contao-versionen', 1, '<p>Alle angebotenen Themes funktionieren mit der <strong>jeweils aktuellsten Version von Contao</strong> (zusÃ¤tzlich stehen in Ihrem Downloadbereich die bisherigen Versionen zur VerfÃ¼gung). Laufende Updates kÃ¶nnen Sie kostenlos Ã¼ber <a href="https://my.rocksolidthemes.com/">Ihren Kundenbereich</a> beziehen. Unter UmstÃ¤nden nÃ¶tige Anpassungen der Themes an neue Contao-Versionen, erscheinen <strong>spÃ¤testens binnen einer Woche</strong> nach dem Update.</p>\n<p>Themes, die bereits seit lÃ¤ngerem existieren stehen teilweise auch fÃ¼r Ã¤ltere Contao-Versionen zur VerfÃ¼gung. So gibt es Aurelium, Eighty/Twenty, Vision und Swissy auch fÃ¼r Contao 2.11 (Achtung: Plugins wie der RockSolid Slider, Theme Assistant und Co. benÃ¶tigen Contao 3). Alle danach erschienenen Themes sind nicht mit Contao 2.11 kompatibel. <a href="http://rocksolidthemes.com/de/contao/faq#technisches">Weitere Informationen zu Updates und Theme-Versionen</a>.</p>', '', NULL, '', '', '', '', '', '', '', '', NULL, '', '1' );
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`) VALUES ( 3, 1, 384, 1385048080, 'Was ist im Lieferumfang enthalten?', 'lieferumfang', 1, '<p>Sie erhalten nach dem Kauf das Theme fÃ¼r die Installation ohne Demo-Daten, sowie das Template (Theme + Demo-Daten) um Ihre Seite mit wenigen Klicks auf den Stand zu bringen, den Sie aus dieser Demo kennen. Die ausfÃ¼hrliche Schritt-fÃ¼r-Schritt-Dokumentation macht Ihnen die Installation leicht. Den gesamten Lieferumfang finden Sie auf der Detailseite des jeweiligen Themes. <a href="http://rocksolidthemes.com/de/contao/faq#download-lieferumfang">Weitere Informationen finden Sie hier</a>.</p>', '', NULL, '', '', '', '', '', '', '', '', NULL, '', '1' );
INSERT INTO `tl_faq` (`id`, `pid`, `sorting`, `tstamp`, `question`, `alias`, `author`, `answer`, `addImage`, `singleSRC`, `alt`, `size`, `imagemargin`, `imageUrl`, `fullsize`, `caption`, `floating`, `addEnclosure`, `enclosure`, `noComments`, `published`) VALUES ( 4, 1, 512, 1385566763, 'Was unterscheidet Open Sauce?', 'opensauce-unterschiede', 1, '<p>ZunÃ¤chst ist kein Support enthalten. AuÃŸerdem verfÃ¼gt Open Sauce Ã¼ber einen kleinen Hinweis in der FuÃŸzeile, den Sie nur mit dem Kauf einer Premium-Lizenz entfernen dÃ¼rfen. Ansonsten ist Open Sauce genau so RockSolid wie alle unsere Premium Themes.</p>', '', NULL, '', '', '', '', '', '', '', '', NULL, '', '1' );
